Catherine Hess, &quot;Italian Maiolica: Catalogue of the Collections&quot;
Getty | 1988 | English | PDF | 143 pages | 24.02 Mb

The outstanding collection of maiolica is significant because most of the major pottery centers, maiolica forms, and styles are represented. This current catalogue presents the collection in a chronological progression according to stylistic trends. Lavish color plates accompany the detailed entries
